import React, {useState, useEffect} from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import BrokerList from './brokerList/BrokerList';
import StockList from './stockList/StockList'; // Импорт stockList

function StartPage() {
    return (
        <div>
            <h1>Стартовое меню</h1>
            <nav>
                <ur>
                    <li>
                        <Link to="/brokers">Список брокеров</Link>
                    </li>
                    <li>
                        <Link to="/stocks">Список акций</Link>
                    </li>
                </ur>
            </nav>
        </div>
    );
}

export default StartPage;
